import React from "react";
import Select from "react-select"

class SelectBar extends React.Component {
    render() {
        return (
            <Select placeholder="Enter keyword .." className="col-xl-5 col-lg-5 col-sm-12"/>
        );
    }
}

export default SelectBar;
